import React from 'react';
import CarouselItem from './CarouselItem';
import classes from './carousel.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAngleLeft, faAngleRight } from '@fortawesome/free-solid-svg-icons';

const Carousel = ({carousel}) => {
  return (
    <div className={classes.carousel}>
        <button className={classes.arrowLeft}><FontAwesomeIcon className={classes.arrowIcon} icon={faAngleLeft}/></button>
          <div className={classes.carouselWrapper}>
            {carousel.map(item => 
              <CarouselItem item={item} key={item.id + 8888}/>
              )}
        </div>
        <button className={classes.arrowRight}><FontAwesomeIcon className={classes.arrowIcon} icon={faAngleRight}/></button>
    </div>
  )
}

export default Carousel
